import React from 'react';
import classes from './Button.module.scss';

const Button = (props) => {
    let el;
    if(props.account){
        el = <div>{props.account}</div>
    } else {
        el = <button text="Login" onClick={props.login}></button>
    }
    return (
        <div>
            {props.account}
            {el}
        </div>
    );
};

export default Button;

